.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #626274;
  padding: 6px;
  border-bottom: 1px solid #363659;
}
.github-Accordion-header::-webkit-details-marker {
  color: #626274;
}
.github-Accordion-content {
  border-bottom: 1px solid #363659;
  background-color: #27273f;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #626274;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #ffffff;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 3px;
  border-bottom: 1px solid #363659;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #363659;
}
